// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "OpenZeppelin/openzeppelin-contracts@4.6.0/contracts/token/ERC20/IERC20.sol";
import "OpenZeppelin/openzeppelin-contracts@4.6.0/contracts/access/Ownable.sol";

contract TokenSaver is Ownable {
    mapping(address => uint256) public savingBalance;
    IERC20 public floToken;

    constructor(address _floTokenAddress) {
        floToken = IERC20(_floTokenAddress);
    }

    function saveToken(uint256 _amount) public {
        floToken.transferFrom(msg.sender, address(this), _amount);
        savingBalance[msg.sender] = savingBalance[msg.sender] + _amount;
    }

    function retrieveTokenAmount() public returns (uint256) {
        return savingBalance[msg.sender];
    }

    function getAllTokens() public {
        uint256 amount = retrieveTokenAmount();
        floToken.transferFrom(address(this), msg.sender, amount);
        savingBalance[msg.sender] = 0;
    }
}
